import { Box, Grid, Stack, Typography } from '@mui/material';
import Selected from '../../../selected/Selected';

function SalaryNWageForm() {
  return (
    <Box component="form">
      <Stack
        component="form"
        direction="column"
        spacing={2}
        sx={{
          paddingLeft: '20px',
          paddingRight: '20px',
          paddingBottom: '20px',
          gap: '10px',
          display: 'flex',
          maxWidth: '560px',
          width: '100%',
        }}
      >
        <Grid
          container
          spacing={'row'}
          sx={{ '&:first-of-type': { marginLeft: '0', marginTop: 0 }, marginTop: '0 !important' }}
        >
          <Grid
            item
            xs={4}
            sx={{
              paddingLeft: '0 !important',
              paddingTop: '0 !important',
              display: 'flex',
              alignItems: 'center',
              marginTop: '0 !important',
            }}
          >
            <Typography
              variant="body2"
              gutterBottom
              sx={{
                fontFamily: 'SVN-Sofia-Regular',
                display: 'flex',
                alignItems: 'center',
                margin: 0,
                fontSize: '16px',
              }}
            >
              Date Start
            </Typography>
          </Grid>
          <Grid item xs={8} sx={{ paddingLeft: '0 !important', paddingTop: '0 !important' }}>
            <Selected
              defaultOption="Choose Department"
              objectOption={['N/A', 'Developer', 'Quanlity Controjk', 'Maintenance', 'Business Developer']}
            />
          </Grid>
        </Grid>
        <Grid
          container
          spacing={'row'}
          sx={{ '&:first-of-type': { marginLeft: '0', marginTop: 0 }, marginTop: '0 !important' }}
        >
          <Grid
            item
            xs={4}
            sx={{
              paddingLeft: '0 !important',
              paddingTop: '0 !important',
              display: 'flex',
              alignItems: 'center',
              marginTop: '0 !important',
            }}
          >
            <Typography
              variant="body2"
              gutterBottom
              sx={{
                fontFamily: 'SVN-Sofia-Regular',
                display: 'flex',
                alignItems: 'center',
                margin: 0,
                fontSize: '16px',
              }}
            >
              Employee Type
            </Typography>
          </Grid>
          <Grid item xs={8} sx={{ paddingLeft: '0 !important', paddingTop: '0 !important' }}>
            <Selected defaultOption="Choose Position" objectOption={['N/A', 'Junior', 'Vice Manager', 'Manager']} />
          </Grid>
        </Grid>
      </Stack>
    </Box>
  );
}

export default SalaryNWageForm;
